slice::<impl [T]>::iter.doc:
Returns an iterator over the slice.

The iterator yields all items from start to end.

# Examples

```
let x = &[1, 2, 4];
let mut iterator = x.iter();

assert_eq!(iterator.next(), Some(&1));
assert_eq!(iterator.next(), Some(&2));
assert_eq!(iterator.next(), Some(&4));
assert_eq!(iterator.next(), None);
```

iter::traits::iterator::Iterator::all.doc:
Tests if every element of the iterator matches a predicate.

`all()` takes a closure that returns `true` or `false`. It applies
this closure to each element of the iterator, and if they all return
`true`, then so does `all()`. If any of them return `false`, it
returns `false`.

`all()` is short-circuiting; in other words, it will stop processing
as soon as it finds a `false`, given that no matter what else happens,
the result will also be `false`.

An empty iterator returns `true`.

# Examples

Basic usage:

```
let a = [1, 2, 3];

assert!(a.into_iter().all(|x| x > 0));

assert!(!a.into_iter().all(|x| x > 2));
```

Stopping at the first `false`:

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

assert!(!iter.all(|x| x != 2));

// we can still use `iter`, as there are more elements.
assert_eq!(iter.next(), Some(3));
```

iter::traits::iterator::Iterator::rev.doc:
Reverses an iterator's direction.

Usually, iterators iterate from left to right. After using `rev()`,
an iterator will instead iterate from right to left.

This is only possible if the iterator has an end, so `rev()` only
works on [`DoubleEndedIterator`]s.

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter().rev();

assert_eq!(iter.next(), Some(3));
assert_eq!(iter.next(), Some(2));
assert_eq!(iter.next(), Some(1));

assert_eq!(iter.next(), None);
```

iter::traits::collect::IntoIterator::int.doc:
Creates an iterator from a value.

See the [module-level documentation] for more.

[module-level documentation]: crate::iter

# Examples

```
let v = [1, 2, 3];
let mut iter = v.into_iter();

assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());
assert_eq!(None, iter.next());
```

iter::traits::iterator::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

